[log]
log.time(DATE)=(^[\d-\s:,]+)\s\w+\s*\[[\w\.]+\]\s.+
log.level=^[\d-\s:,]+\s(\w+)\s*\[[\w\.]+\]\s.+
log.class=^[\d-\s:,]+\s\w+\s*\[([\w\.]+)\]\s.+
log.data=^[\d-\s:,]+\s\w+\s*\[[\w\.]+\]\s(.+)

[logOld]
log.class=\[([\w\.]+)\]
log.level=^[\d-\s:,]+(\w+)
log.time(DATE)=(^[\d-\s:,]+)
log.data=\[[\w\.]+\]\s(.+)